import React from "react";
import "./css/About.css";
class About extends React.Component {
  state = {};
  render() {
    return (
      <div className="about" id="about">
        <div className="left-side"></div>
        <div className="right-side">
          <div className="content">
            <h1>About</h1>
            <h1></h1>
          </div>
        </div>
      </div>
    );
  }
}

export default About;
